import { Component } from "react";

class Detailed extends Component{

    render(){
        return(
            <div className="detailed row">
            <div className="col-md-6">
                <img src="https://flagcdn.com/w320/bw.png"/>
            </div>
            <div className="col-md-6"></div>
        </div>
        )
    }
}
export default Detailed
